import React, { useState } from 'react';
import './App.css';

function App() {
  const [activeTab, setActiveTab] = useState('home');

  const tabs = [
    { id: 'home', label: 'Home' },
    { id: 'about', label: 'About SOAR' },
    { id: 'speakers', label: 'Speakers' },
    { id: 'schedule', label: 'Schedule' },
    { id: 'registration', label: 'Register' }
  ];

  const renderContent = () => {
    switch (activeTab) {
      case 'home':
        return (
          <div className="page-content">
            <div className="home-layout">
              <div className="image-placeholder left-image">
                <p>LEFT IMAGE</p>
              </div>
              <div className="home-center">
                {/* Home page content - add your content here */}
              </div>
              <div className="image-placeholder right-image">
                <p>RIGHT IMAGE</p>
              </div>
            </div>
          </div>
        );

      case 'about':
        return (
          <div className="page-content">
            {/* About page content - add your content here */}
          </div>
        );

      case 'speakers':
        return (
          <div className="page-content">
            {/* Speakers page content - add your content here */}
          </div>
        );

      case 'schedule':
        return (
          <div className="page-content">
            {/* Schedule page content - add your content here */}
          </div>
        );

      case 'registration':
        return (
          <div className="page-content">
            {/* Registration page content - add your content here */}
          </div>
        );

      default:
        return <div>Page not found</div>;
    }
  };

  return (
    <div className="App">
      <header className="header">
        <div className="header-content">
          <div className="logo">
            <h1>SOAR 2026</h1>
          </div>
          <nav className="nav">
            {tabs.map(tab => (
              <button
                key={tab.id}
                className={`nav-button ${activeTab === tab.id ? 'active' : ''}`}
                data-register={tab.id === 'registration' ? 'true' : 'false'}
                onClick={() => setActiveTab(tab.id)}
              >
                {tab.label}
              </button>
            ))}
          </nav>
        </div>
      </header>
      <main className="main-content">
        {renderContent()}
      </main>
      <footer className="footer">
        <p>&copy; 2026 SOAR Conference. All rights reserved.</p>
      </footer>
    </div>
  );
}

export default App;
